import { FETCH_COMMENTS, FETCH_COMMENTS_REQUEST, FETCH_COMMENTS_FAILURE, FETCH_COMMENTS_SUCCESS } from "./types";

const initialState = {
    items: [],
    loading: false,
    err: null
}
const commentsReducer = (state = initialState, action) => {
    switch (action.type) {
        default: return state;
    }
}
export default commentsReducer;
